import React, { useEffect } from "react";

function Login(props) {
    const menuItems = ["Login", "Users"]

    // Create Bottom menu when page is called
    useEffect( () => {
        props.SetBottomMenu(menuItems)
        }, [])

    // 

    return <div>
        Login
    </div>
}

export default Login;
